-- ----------------------------
-- Records of organ_list
-- ----------------------------
INSERT INTO `organ_list` VALUES ('1', 'Heart', 'A muscular organ that pumps blood through the body.  A heart transplant can be used to help those suffering from heart failure, as well as babies born with heart defects', 'Organ', '', 'fa-heartbeat', 'red');
INSERT INTO `organ_list` VALUES ('2', 'Liver', 'A large organ that secretes bile and is active in the formation of certain blood proteins and in the metabolism of carbohydrates, fats, and proteins.  Liver transplants may be used to treat various conditions which cause liver failure, such as cirrhosis or liver cancer', 'Organ', '', 'fa-sitemap', 'blue');
INSERT INTO `organ_list` VALUES ('3', 'Kidneys', 'A pair of organs that maintain proper water and electrolyte balance, regulate acid-base concentration, and filter the blood of metabolic waste, which is excreted as urine.  The kidneys are the most commonly transplanted organ.  A kidney transplant may be recommended for those who have been diagnosed with chronic end stage renal disease (severe kidney failure)', 'Organ', '', 'fa-ambulance', 'teal');
INSERT INTO `organ_list` VALUES ('4', 'Lungs', 'A pair of two spongy organs that remove carbon dioxide from the blood and provide it with oxygen. Lung transplants are recommended for those with severe lung disease, such as cystic fibrosis, COPD (chronic obstructive pulmonary disease) and emphysema', 'Organ', '', 'fa-medkit', 'orange');
INSERT INTO `organ_list` VALUES ('5', 'Pancreas', 'Long, irregularly shaped gland which lies behind the stomach and aids in the digestion of proteins, carbohydrates, and fats. Pancreatic transplants are indicated for those with insulin-dependent Type I diabetes', 'Organ', '', 'fa-thermometer-half', 'yellow');
INSERT INTO `organ_list` VALUES ('6', 'Intestines', 'The portion of the digestive tract extending from the stomach to the anus, consisting of upper and lower segments. Patients qualify for intestine transplants if they have been diagnosed with life-threatening intestinal diseases such as total parenteral nutrition or short-gut syndrome', 'Organ', '', 'fa-universal-access', 'green');
INSERT INTO `organ_list` VALUES ('7', 'Cornea', 'The outer curved transparent tissues covering the iris and pupils on the outside of the eye.  Cornea transplants are a common procedure used to restore vision for those with eye diseases and corneal infections', 'Tissues', '', 'fa-eye', 'pink');
INSERT INTO `organ_list` VALUES ('8', 'Skin', 'A tissue which protects the body from infection and injury. Skin transplants, referred to as skin grafts, are used to treat severe burns, extensive wounding and skin loss due to infection', 'Tissues', '', 'fa-recycle', 'purple');
INSERT INTO `organ_list` VALUES ('9', 'Heart Valves', ' Tissues that prevent the back flow of blood into the heart. Heart valve transplants are used to treat malfunctioning heart valves caused by infections, birth defects and aging', 'Tissues', '', 'fa-heartbeat', 'red');
INSERT INTO `organ_list` VALUES ('10', 'Tendons', 'Tissues which attach muscles to bones. Tendon transplants are recommended for patients who have lost muscle function and due to nerve injury or damage to tendons', 'Tissues', '', 'fa-puzzle-piece', 'cyan');

